import React from 'react';
import './PopCheckboxesStyles.scss';

const PopCkeckBoxes = () => {
	return(
		<div className="pop_checkbox_container">
		  <input id="album_checkbox" type="checkbox" className='pop_checkboxes' />
		  <label for="album_checkbox">Same Album</label>

		  <input id="artiste_checkbox" type="checkbox" className='pop_checkboxes' />
		  <label for="artiste_checkbox">This Artiste</label>

		  <input id="genre_checkbox" type="checkbox" className='pop_checkboxes' />
		  <label for="genre_checkbox">Genre</label>

		  <input id="era_checkbox" type="checkbox" className='pop_checkboxes' />
		  <label for="era_checkbox">Year/Era</label>

		  <input id="associate_checkbox" type="checkbox" className='pop_checkboxes' />
		  <label for="associate_checkbox">Associate Artiste</label>
		</div>
	);
}

export default PopCkeckBoxes;
